import { SET_DETAILS } from '../Actions';
const initialState = {
    details: []
}

const Details = (state = initialState, action) => {
    switch(action.type) {
        case SET_DETAILS : 
            return {...state, data: action.data}
        default :
            return state;
    }
}

export default Details
